import React, { useState } from 'react';
import axios from 'axios';
import './Login.css';

function MemberSignUpForm() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [membershipStartDate, setMembershipStartDate] = useState('');
  const [membershipEndDate, setMembershipEndDate] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    const formData = {
      name,
      email,
      password,
      phone,
      membership_start_date: membershipStartDate,
      membership_end_date: membershipEndDate
    };
    try {
      const response = await axios.post('/api/members', formData);
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Member Sign Up</h2>
      <label>
        <span>Name:</span>
        <input type="text" value={name} onChange={(event) => setName(event.target.value)} required />
      </label>
      <label>
        <span>Email:</span>
        <input type="email" value={email} onChange={(event) => setEmail(event.target.value)} required />
      </label>
      <label>
        <span>Password:</span>
        <input type="password" value={password} onChange={(event) => setPassword(event.target.value)} required />
      </label>
      <label>
        <span>Phone:</span>
        <input type="tel" value={phone} onChange={(event) => setPhone(event.target.value)} />
      </label>
      <label>
        <span>Membership Start Date:</span>
        <input type="date" value={membershipStartDate} onChange={(event) => setMembershipStartDate(event.target.value)} required />
      </label>
      <label>
        <span>Membership End Date:</span>
        <input type="date" value={membershipEndDate} onChange={(event) => setMembershipEndDate(event.target.value)} required />
      </label>
      <button type="submit">Sign Up</button>
    </form>
  );
}
